import React, { Component } from "react";

import Header from "./Header";
import Grid from "./Grid.jsx";

export default class AVLTreeVisualizer extends Component {
    constructor() {
        super();
        this.state = {};
        this.tree = null;
    }

    render() {
        return (
            <div>
                <Header tree={this.tree}/>
                <Grid />
            </div>
        );
    }
}
